import React,
      { Component } from 'react';
import { Link } from 'react-router-dom'

import Languages from './Languages';

class Header extends Component {
  render() {
    return (
      <div data-component="header">

        <div className="container-page hidden">

          <div data-track-header>

            <div data-logo>
              <i></i> OliveiraCap
            </div>

            <Languages />

            <button data-glass="small" className="f-right m5">Login</button>

          </div>

          <div data-menu>

            <nav>
              <ul>
                <li>Sobre</li>
                <li>Servicos</li>
                <li>Contato</li>
                <li>F.A.Q</li>
              </ul>
            </nav>

          </div>

        </div>
      </div>
    );
  }
}
export default Header;
